  "text" : "\uACBD\uC81C\uC801 \uC591\uADF9\uD654, \uCDE8\uC5C5\uB09C\uC73C\uB85C \uC0AC\uD68C\uC801 \uBD84\uB9AC\uC120\uC774 \uC2EC\uD654\uB418\uB294 \uD0D3\uC774 \uD06C\uAE34 \uD560 \uAC83\uC774\uACE0. \uC0AC\uD68C\uC758 \uBD84\uD654\uC5D0 \uB530\uB77C \u2018\uACF5\uD1B5 \uACBD\uD5D8\u2019\uC774\uB77C\uB294 \uAC83\uC774 \uC810\uCC28 \uC904\uC5B4\uB4DC\uB294 \uAC83\uC774 \uB610\uD55C \uD070 \uC6D0\uC778\uC77C \uAC83\uC774\uB2E4. \uADF8\uB7F0\uB370 \uADF8 \uC810\uC744 \uBCF4\uBA74 \uACF5\uAD50\uC721\uC758 \u2018\uC2DC\uBBFC\uC131 \uAD50\uC721\u2019\uC758 \uCC45\uC784\uC740 \uC5BC\uB9C8\uB098 \uD070\uAC00. \uAD70\uB300\uB3C4 \uB9C8\uCC2C\uAC00\uC9C0.",
