  "text" : "\uBE44\uBA85\uC18C\uB9AC\uC640 \uC870\uB871\uD558\uB294 \uC18C\uB9AC\uB9CC \uC591\uCABD\uC5D0\uC11C \uB09C\uBB34\uD55C\uB2E4\uB294 \uB290\uB08C\uC774 \uB4E4 \uB54C\uAC00 \uB9CE\uB2E4. \uADF8\uAC8C \uCC28\uB77C\uB9AC \uD55C \uD3B8\uC5D0\uC11C \uC9C0 \uC798\uB09C \uB9DB\uC5D0, \uB2E4\uB978 \uD55C \uD3B8\uC5D0\uC11C \uC815\uB9D0 \uAD34\uB85C\uC6CC\uC11C \uB098\uB294 \uC18C\uB9AC\uB77C\uBA74 \uBD88\uAC00\uD53C\uD558\uC9C0\uB9CC, \uC0C1\uB300\uC758 \uBC29\uD5A5\uC744 \uC548 \uBCF4\uACE0 \uBCBD\uACFC \uAC00\uC0C1\uC758 \uC6B0\uAD70\uC744 \uBCF4\uACE0 \uC678\uCE58\uB294 \uD655\uB960\uC774 \uB354 \uB192\uC740 \uAC83 \uAC19\uB2E4.",
