  "text" : "\uADF8\uB7F0 \uCC28\uC6D0\uC5D0\uC11C \uBCFC\uB54C \uBD84\uB9AC\uC8FC\uC758\uC801 \uD574\uBC95\uC740 \uD558\uB4F1\uC758 \uB3C4\uC6C0\uC774 \uC548\uB41C\uB2E4. \uB048\uB355\uC9C0\uAC8C \uC2F8\uC6B0\uACE0 \uD611\uC0C1\uD558\uC5EC \uD0C0\uD611\uC548\uC744 \uB3C4\uCD9C\uD558\uACE0, \uC2EB\uC740\uAC83\uACFC \uB9C8\uC8FC\uD558\uB294 \uB2A5\uB825\uC744 \uAE38\uB7EC\uC57C \uD558\uB294\uB370 \uBB38\uC81C\uD574\uACB0\uB825 \uC790\uCCB4\uAC00 \uC0AC\uD68C\uC801\uC73C\uB85C \uB5A8\uC5B4\uC9C0\uB294 \uB4EF. 2000\uB144\uB300 \uC911\uBC18\uD559\uBC88 \uC774\uD6C4 \uBB38\uC81C\uB77C\uACE0 \uBD24\uC5C8\uC9C0\uB9CC \uAF2D\uADF8\uB807\uC9C4 \uC54A\uC740 \uB4EF.",
